import { useContext, useState } from "react";
import { Link } from "react-router-dom";
import AuthContext from "../context/AuthContext";
import LoginPage from "../views/LoginPage"
import Register from "../views/RegisterPage";
import "../App.css"

const Navbar = () => {
  const { user, logoutUser } = useContext(AuthContext);
  const [Form, setForm] = useState("login");

  const toggleForm = (formName) =>{
    setForm(formName)
  }
  return (
    <nav>
      <div>
        <div className="nav-bar">
          <button className="app-name">GroupFlow</button>
          {
          user ? 
          <div className="home-nav-btn-container">
            <button className="home-nav-btn" onClick={logoutUser}>Logout</button>
            <Link className="home-nav-btn" to="/">Home</Link>
            <Link className="home-nav-btn" to="/protected">Protected Page</Link>
          </div>
          :
          <></>
          } 
        </div>
        <div>
          {user ? (
            <> </>
          ) : (
            <div className="auth-form">
              {Form === 'login' ? <LoginPage onFormSwitch={toggleForm} /> : <Register onFormSwitch={toggleForm}/>} 
            </div>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
